const Todo = (props) => {
    const todos = props.todos;
    return (
        <ul className='list-todos'>
            <li>{props.title}</li>
            {
                todos.map(todo => {
                    return (
                        <li className='list-item' key={todo.id}>{todo.name}</li>
                    )
                }
                )
            }
        </ul>
    )
}

export default Todo;
